/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`%`*/ /*!50003 TRIGGER `enrolInsert_ClassCountUpd` AFTER INSERT ON `enrolments` FOR EACH ROW BEGIN
        UPDATE classes
        SET
            enrolCount = enrolCount + 1,
            actEnr = IF(NEW.enrolmentType = 1, actEnr + 1, actEnr),
            muEnr = IF(NEW.enrolmentType = 2, muEnr + 1, muEnr),
            trEnr = IF(NEW.enrolmentType = 3, trEnr + 1, trEnr),
            waEnr = IF(NEW.enrolmentType = 4, waEnr + 1, waEnr)
        WHERE classes.id = NEW.classId;
    END */;;
