/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`%`*/ /*!50003 TRIGGER `af_EnrolUpdate_ClassCountUpd` AFTER UPDATE ON `enrolments` FOR EACH ROW insertTrigger: BEGIN
    IF @trigger_disabled = true THEN 
        LEAVE insertTrigger;
    ELSE
     #If enrolment was deactivated or reactivate.
        IF NEW.isValid = 0 THEN
            UPDATE classes
                SET enrolCount = IF(NEW.enrolmentType <> 4, IF(enrolCount = 0, 0, enrolCount - 1), enrolCount),
                    actEnr = IF(NEW.enrolmentType = 1, IF(actEnr = 0, 0, actEnr - 1), actEnr),
                    muEnr = IF(NEW.enrolmentType = 2, IF(muEnr = 0, 0, muEnr - 1), muEnr),
                    trEnr = IF(NEW.enrolmentType = 3, IF(trEnr = 0, 0, trEnr - 1), trEnr),
                    waEnr = IF(NEW.enrolmentType = 4, IF(waEnr = 0, 0, waEnr - 1), waEnr)
                WHERE NEW.classId = classes.id;
        END IF;
        IF NEW.isValid = 1 AND OLD.isValid = 0 THEN
            UPDATE classes
                SET enrolCount = IF(NEW.enrolmentType <> 4, enrolCount + 1, enrolCount),
                    actEnr = IF(NEW.enrolmentType = 1, actEnr + 1, actEnr),
                    muEnr = IF(NEW.enrolmentType = 2, muEnr + 1, muEnr),
                    trEnr = IF(NEW.enrolmentType = 3, trEnr + 1, trEnr),
                    waEnr = IF(NEW.enrolmentType = 4, waEnr + 1, waEnr)
                WHERE NEW.classId = classes.id;
        END IF;
        #Drop Enrolment by if NEW.dropDate is before now.
        IF NEW.dropDate < NOW() AND NEW.dropDate IS NOT NULL AND NEW.isValid = 1 THEN
            UPDATE classes
                SET enrolCount = IF(NEW.enrolmentType <> 4, IF(enrolCount = 0, 0, enrolCount - 1), enrolCount),
                    actEnr = IF(NEW.enrolmentType = 1, IF(actEnr = 0, 0, actEnr - 1), actEnr),
                    muEnr = IF(NEW.enrolmentType = 2, IF(muEnr = 0, 0, muEnr - 1), muEnr),
                    trEnr = IF(NEW.enrolmentType = 3, IF(trEnr = 0, 0, trEnr - 1), trEnr),
                    waEnr = IF(NEW.enrolmentType = 4, IF(waEnr = 0, 0, waEnr - 1), waEnr)
                WHERE NEW.classId = classes.id;
        END IF;
        # Change of enrolment type calculation.
        IF NEW.enrolmentType <> OLD.enrolmentType AND NEW.isValid = 1 AND NEW.classId = OLD.classId THEN
                UPDATE classes
                    SET
                        enrolCount = 
                            IF(
                                OLD.enrolmentType = 4, enrolCount + 1, 
                            IF(
                                NEW.enrolmentType = 4, enrolCount - 1, enrolCount)),
                        actEnr = IF(OLD.enrolmentType = 1, IF(actEnr = 0, 0, actEnr = actEnr - 1), actEnr),
                        muEnr = IF(OLD.enrolmentType = 2, IF(muEnr = 0, 0, muEnr = muEnr - 1), muEnr),
                        trEnr = IF(OLD.enrolmentType = 3, IF(trEnr = 0, 0, trEnr = trEnr - 1), trEnr),
                        waEnr = IF(OLD.enrolmentType = 4, IF(waEnr = 0, 0, waEnr = waEnr - 1), waEnr),
                        actEnr = IF(NEW.enrolmentType = 1, actEnr + 1, actEnr),
                        muEnr = IF(NEW.enrolmentType = 2, muEnr + 1, muEnr),
                        trEnr = IF(NEW.enrolmentType = 3, trEnr + 1, trEnr),
                        waEnr = IF(NEW.enrolmentType = 4, waEnr + 1, waEnr)
                    WHERE NEW.classId = classes.id;
        END IF;
    END IF;
